import React from "react";
import "./App.css"
import Login from "./Login";
import Navbar from "./Components/Header/Navbar";
import {Routes, Route, BrowserRouter } from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<Login />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
